            #--> input: 4x3x28x28 (color image)

            nn.Conv2d(self.channels, 32, (5, 5), stride=1, padding=2),
            nn.BatchNorm2d(num_features = self.conv1),
            nn.ReLU(),
            nn.MaxPool2d((2, 2), stride=2, padding=0), # --> output: [4, 32, 16, 16]

